import React, {Component} from 'react'
import logo from './logo.svg';
import './App.css';
import UploadFiles from "./components/upload-files.component";
import DocViewer from "react-doc-viewer";
import DocProvider from './providers/DocProvider'
import DocContext from './providers/DocContext';
class App extends Component {



  constructor(props){
    super(props);
    this.state = {
      message : ""
    }
  }
  render(){
    return (
      <DocProvider>
      <div className="App">
        <div className="App-header">

          <h2>
          Welcome to DataCap Uploader
          </h2>
            <DocContext.Consumer>
              <h1></h1>
            </DocContext.Consumer>
           <UploadFiles />
          </div>


      </div>
      </DocProvider>
    );
  }
}

export default App;
